-- 메시지가 넘어오는 토픽에 대한 스키마 정의 스트림 생성
CREATE STREAM MOCK_DATA_STREAM_stream (
  id INT,
  first_name STRING,
  last_name STRING,
  email STRING,
  gender STRING,
  ip_address STRING,
  purchase_id INT,
  product_name STRING,
  quantity INT,
  unit_price DOUBLE,
  total_price DOUBLE,
  purchase_date STRING,
  customer_id INT,
  payment_method STRING,
  shipping_address STRING,
  status STRING
) WITH (
  KAFKA_TOPIC = 'mock_data',
  VALUE_FORMAT = 'JSON'
);

-- 특정 이벤트가 넘어오는 조건에 대한 쿼리 결과 스트림 생성
CREATE STREAM mock_alert_stream
  WITH (KAFKA_TOPIC='mock_alert', VALUE_FORMAT='JSON') AS
SELECT
  '⚠️ 주문에 결제 수단이 없습니다 - 제품: ' + product_name + ', 총액: ' + CAST(total_price AS STRING) AS "text"
FROM mock_data_stream
WHERE payment_method IS NULL;

CREATE STREAM mock_alert_stream_test
  WITH (KAFKA_TOPIC='mock-alert', VALUE_FORMAT='JSON') AS
SELECT
  '⚠️ 주문에 결제 수단이 없습니다 - 주문번호: ' + CAST(purchase_id AS STRING) + ', 제품: ' + product_name + ', 총액: ' + CAST(total_price AS STRING) AS "text"
FROM mock_data_stream
WHERE payment_method IS NULL;

CREATE STREAM MOCK_ALERT_STREAM_TEMP
  WITH (KAFKA_TOPIC='mock_alert_temp', VALUE_FORMAT='JSON') AS
SELECT *
FROM mock_data_stream
WHERE payment_method IS NULL;

